const initState = {
  channels: [
    { id: "1", title: "help me find peach", description: "blah blah blah" },
    { id: "2", title: "collect all the stars", description: "blah blah blah" },
    { id: "3", title: "egg hunt with yoshi", description: "blah blah blah" },
  ],
};

const channelReducer = (state = initState, action) => {
  switch (action.type) {
    case "CREATE_CHANNEL_SUCCESS":
      console.log("created channel success");
      return state;
    case "CREATE_CHANNEL_ERROR":
      console.log("create channel error");
      return state;
    default:
      return state;
  }
};

export default channelReducer;
